@mxgp | Prado’s first of 2021

Jorge Prado’s first podium appearance in MXGP 2021 was made with overall victory at a bumpy Loket circuit for the Grand Prix of Czech Republic. The Spaniard claimed his maiden moto win of the season to go 1-3 on the day and is up to 3rd in the world championship.

#ReadyToRace #MXGP #motocross #mxgpczechrepublic #KTM @jorgeprado61

@mxgp | Cairoli closes on MXGP championship lead

2nd position and four podiums from five rounds of 2021 MXGP means Tony Cairoli is right in the hunt for the crown with almost one third of the season in the books. Cairoli is just 11 points behind Tim Gajser after winning his third moto of the year in the Czech Republic today.

#ReadyToRace #MXGP #motocross #MXGPNetherlands #KTM @antoniocairoli

@mxgp | Second GP win of 2021 for star MX2 rookie Guadagnini

Mattia Guadagnini ruled the Grand Prix of Czech Republic thanks to a 1-5 scorecard for his second overall victory in just his fifth appearance in Red Bull KTM colors. The Italian used the power of his KTM 250 SX-F to move to within 2 points of the world championship lead. Tom Vialle returned to action with a strong 2nd position in the first moto and Rene Hofer clinched 4th in the second race.

